import React from "react";
/** @jsx jsx */
import { css, jsx } from "@emotion/core";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";
import moment from "moment";
import { EventResponse } from "../../../requests/eventTypes";

type Props = {
  event: EventResponse;
};

const EventCard = ({ event }: Props) => {
  const { name, date, attendees, rsvps } = event;

  const attendancePercent = Math.round((attendees / rsvps) * 100);
  return (
    <Card
      css={css`
         {
          padding: 15px;
        }
      `}
    >
      <h5>{name}</h5>
      <CardSubtitle
        css={css`
           {
            font-size: 12px;
          }
        `}
      >
        {moment(date).format("MM/DD/YY")}
      </CardSubtitle>
      <CardText>
        <div
          css={css`
             {
              display: flex;
              flex-direction: row;
              justify-content: center;
            }
          `}
        >
          <div>
            <h4>{event.attendees}</h4> Attendees
          </div>
          <div>
            <h4>({attendancePercent}%)</h4>Show Rate
          </div>
        </div>
      </CardText>
    </Card>
  );
};

export default EventCard;
